Open Door Ministries is offering martial arts classes to the public, including Taekwondo and Karate. I am teaching the karate classes, and would also like to add boxing and fitness training sessions. We have a fully equipped, spacious area set up for classes, which are currently being held on Saturdays, with Taekwondo starting promptly at 12pm. Mr. Andy, who runs Open Door Ministries, also hopes to host competitions. Of course, we would ultimately like to charge fees for classes, but we want to gauge interest first. If you are interested in training, or have any questions, please get in touch with me, or stop by Open Door Ministries and talk to Mr. Andy. We are also looking for people who can teach wrestling or other martial arts. Feel free to get in touch with me via any of the contact methods on my website, and I'll get back to you as soon as possible. My website also lists my qualifications and experience.
